import { useState } from "react"

export default function Botao(){
    const [count, adiciona,] = useState(0);

    function handleClick() {
      adiciona(count + 1);
    }
  
    return (
      <button onClick={handleClick}>
        Clicked {count} times
      </button>
    );
  
    
    
}
